import React from 'react';
import { Paper, Typography, TextField, Grid, Container } from '@mui/material';

const Profile = ({ name, email }) => { // Removed 'age' since it's not provided by the registration form
  return (
    <Container component="main" maxWidth="sm">
      <Paper elevation={6} style={{ marginTop: '2rem', padding: '2rem' }}>
        <Typography variant="h4" align="center" gutterBottom>
          Profile Information
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <TextField
              fullWidth
              label="First Name"
              value={name}
              InputProps={{
                readOnly: true,
              }}
              variant="filled"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Last Name"
              value={name} // You might want to pass lastName separately if it's different from firstName
              InputProps={{
                readOnly: true,
              }}
              variant="filled"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Email"
              value={email}
              InputProps={{
                readOnly: true,
              }}
              variant="filled"
            />
          </Grid>
          {/* You can add additional fields here */}
        </Grid>
      </Paper>
    </Container>
  );
};

export default Profile;
